import React from 'react';
import Chekboxhtml from './chekboxhtml';

const chekboxhtml_list = (props) => props.chekboxhtml_list.map((arrayheading) =>{
        return  <Chekboxhtml
                   classs={arrayheading.classs}
                   checked={arrayheading.checked}
                   changes={(event) => props.changed(event, arraypersons.id)}
                />
     });

export default chekboxhtml_list;
